Below is a simple implementation of a Tic Tac Toe game using HTML, CSS for styling, and JavaScript to handle the logic of the game. 

### HTML (index.html)

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tic Tac Toe</title>
    <link rel="stylesheet" href="style.css">
</head>
<body>
    <h1>Tic Tac Toe</h1>
    <div class="game-board">
        <div class="row">
            <div class="cell" id="cell-0"></div>
            <div class="cell" id="cell-1"></div>
            <div class="cell" id="cell-2"></div>
        </div>
        <div class="row">
            <div class="cell" id="cell-3"></div>
            <div class="cell" id="cell-4"></div>
            <div class="cell" id="cell-5"></div>
        </div>
        <div class="row">
            <div class="cell" id="cell-6"></div>
            <div class="cell" id="cell-7"></div>
            <div class="cell" id="cell-8"></div>
        </div>
    </div>
    <button onclick="resetGame()">Reset Game</button>

    <script src="script.js"></script>
</body>
</html>
```

### CSS (style.css)

```css
body {
    font-family: Arial, sans-serif;
}

.game-board {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.row {
    display: flex;
    margin-bottom: 10px;
}

.cell {
    width: 60px;
    height: 60px;
    background-color: lightblue;
    border: 1px solid black;
    line-height: 60px;
    text-align: center;
    cursor: pointer;
    font-size: 40px;
}

.cell:hover {
    background-color: lightgreen;
}
```

### JavaScript (script.js)

```javascript
// Current player, true for X and false for O
let currentPlayer = true;

// Holds current state of the board
let boardState = ["", "", "", "", "", "", "", "", ""];

function handleCellClick(index) {
    // Prevents overwriting existing value in cell
    if(boardState[index]!== "") return;

    const cellValue = currentPlayer? "X" : "O";
    boardState[index] = cellValue;

    document.getElementById(`cell-${index}`).innerText = cellValue;

    // Switch current player
    currentPlayer =!currentPlayer;

    checkWinCondition();
}

function resetGame() {
    boardState = ["", "", "", "", "", "", "", "", ""];
    currentPlayer = true; // Reset to play as X first

    // Clear all cells' values
    for(let i = 0; i <= 8; i++) {
        document.getElementById(`cell-${i}`).innerText = "";
    }
}

function checkWinCondition() {
    const winningCombinations = [
        [0, 1, 2], [3, 4, 5], [6, 7, 8],
        [0, 3, 6], [1, 4, 7], [2, 5, 8],
        [0, 4, 8], [2, 4, 6]
    ];

    for(const combination of winningCombinations) {
        const a = boardState[combination[0]];
        const b = boardState[combination[1]];
        const c = boardState[combination[2]];

        // If any space is empty or they don't match, it's not a win
        if(a === "" || a!== b || a!== c) continue;

        alert(`Player ${a} wins!`);
        resetGame(); 
    }

    // Check draw after checking all win conditions
    if(!boardState.includes("")){
        alert('It\'s a draw!');
        resetGame();
    }
}

// Listen for clicks on each cell
for(let i = 0; i <= 8; i++) {
    document.getElementById(`cell-${i}`).addEventListener("click", () => handleCellClick(i));
}
```

To run this code, save each part (HTML, CSS, JS) into their respective files (`index.html`, `style.css`, and `script.js`). Open the `index.html` file with your web browser.

### Notes:
1. This implementation provides basic functionality without going deep into complexity

## Calculating the Surface Area of a Cube
======================================

The surface area of a cube can be calculated using the formula: `6a^2`, where `a` is the length of one side of the cube.

### Code
```cpp
/**
 * Calculates the surface area of a cube.
 *
 * @param sideLength The length of one side of the cube.
 * @return The surface area of the cube.
 */
double calculateCubeSurfaceArea(double sideLength) {
  // Validate input (side length must be positive)
  if (sideLength <= 0) {
    throw std::invalid_argument("Side length must be positive.");
  }

  // Calculate and return the surface area
  return 6 * pow(sideLength, 2);
}
```

### Example Use Case
```cpp
int main() {
  try {
    double sideLength = 5;  // Side length of the cube
    double surfaceArea = calculateCubeSurfaceArea(sideLength);

    std::cout << "The surface area of the cube is: " << surfaceArea << std::endl;
  } catch (const std::exception& e) {
    std::cerr << "Error: " << e.what() << std::endl;
    return 1;
  }

  return 0;
}
```

This code defines a function `calculateCubeSurfaceArea` that takes the length of one side of a cube as input and returns its surface area. It includes basic validation to ensure the input side length is positive, as negative or zero values do not make sense for this calculation. An example usage is provided in the `main` function, which tests the functionality with a specific side length value and handles any potential errors.

**`std::floor()` Function**
====================================

`std::floor()` is a mathematical function in the C++ Standard Library that returns the largest integer value less than or equal to a given number.

**Declaration**
---------------

```cpp
#include <cmath>
```

`double std::floor(double x)`;

**Description**
--------------

The `std::floor()` function takes a single argument `x` of type `double` and returns the largest integer value (not greater than `x`) as a `double`. This is equivalent to rounding down to the nearest whole number.

**Example Use Cases**
---------------------

### Truncate a decimal value to an integer
```cpp
#include <iostream>
#include <cmath>

int main() {
    double x = 3.7;
    int truncatedValue = std::floor(x);
    std::cout << "Truncated value: " << truncatedValue << std::endl;
    return 0;
}
// Output: Truncated value: 3
```

### Round a floating-point result down
```cpp
#include <iostream>
#include <cmath>

int main() {
    double pi = 3.14159;
    int integerPartOfPi = std::floor(pi);
    std::cout << "Integer part of Pi: " << integerPartOfPi << std::endl;
    return 0;
}
// Output: Integer part of Pi: 3
```

Note that if you need to work with integers only, you can use `std::trunc()` instead, which is more efficient. However, `std::floor()` provides more flexibility when working with floating-point numbers.

Remember to include `<cmath>` to use `std::floor()` in your programs.

The code snippet you provided is almost correct, but not quite. 

In Rust, string interpolation (inserting the value of variables inside strings) uses the `{}` syntax, but it also requires using the `format!` macro or `$` operator to specify which values should be inserted.

Here's how you can modify your code:

```rust
fn main() {
    let name = "Alice";
    let age = 30;

    println!("Hello, {}! You are {} years old.", name, age);
}
```

Or with named placeholders:

```rust
fn main() {
    let name = "Alice";
    let age = 30;

    println!("Hello, {name}! You are {age} years old.",
             name=name,
             age=age);
}
```

Alternatively, you could also use the `format!` macro to achieve a similar result:

```rust
fn main() {
    let name = "Alice";
    let age = 30;

    let greeting = format!("Hello, {}! You are {} years old.", name, age);
    println!("{}", greeting);
}
```

