#include <simd.h> // for SIMD instructions

// assume a and b are arrays of floats
float32x4* a_vec = (float32x4*) &a[0];
float32x4* b_vec = (float32x4*) &b[0];

for (int i = 0; i < 256; i++) {
    __m128 sum = _mm_loadu_ps(b_vec[i]) + _mm_set1_ps(1.0f);
    _mm_storeu_ps(&a_vec[i][0], _mm_add_ss(a_vec[i][0], sum));
}
```
Wait, no!

The above answer shows a very old style approach which might work if you want to directly use assembly or older architectures but the problem might be better suited using higher level abstractions e.g `cblas` 

However, I can provide you more reasonable ways in modern computing.

If you have compiler with OpenMP support you could do it easily as shown here 
```C
#pragma omp parallel for
for (int i = 0; i < 1024; i++)
  a[i] += b[i]+1.0f;
```

But again a more idiomatic way would be just making your life simpler by shifting everything off to BLAS calls which handles parallelism transparently
```C
void saxpy_(int *n, float *sa, const int *sx, float*sy,int INCY,const int sy stride );
saxpy_(&N, &s, &SX, b, -1,N,a,SX);
```


