Creating a full-featured GUI (Graphical User Interface) library is quite a complex task that typically requires thousands of lines of code and a deep understanding of operating system-specific graphics APIs, event handling, and other intricacies. For the sake of simplicity and to fit within a reasonable response size, I'll show you a very minimalist example of how you might start constructing such a library in C99.

This example focuses on creating simple windows with basic text rendering, which doesn't even begin to scratch the surface of a fully capable GUI library like GTK+, QT, or SDL. However, it's a starting point for learning about creating graphical interfaces from scratch under Linux (which uses X11). 

Please note, you will need development packages for `X11` installed (`libx11-dev` package or similar in your Linux distribution) to compile this.

```c
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

// Include the necessary X11 headers
#include <X11/Xlib.h>
#include <X11/Xutil.h>

// Structure to hold window information
typedef struct {
    Display *display;
    Window window;
} MyWindow;

// Create a new window
MyWindow create_window(int width, int height) {
    MyWindow mw;

    // Open connection to display server
    if (!(mw.display = XOpenDisplay(NULL))) {
        fprintf(stderr, "Failed to open display\n");
        exit(EXIT_FAILURE);
    }

    // Set the screen number (usually 0)
    Screen *screen = DefaultScreen(mw.display);
    // Create the window
    mw.window = XCreateSimpleWindow(
                  mw.display,
                  RootWindow(mw.display, 0),
                  100, 100, width, height, 1,
                  WhitePixel(mw.display, 0), BlackPixel(mw.display, 0));

    // Event masks for receiving messages
    XSelectInput(mw.display, mw.window, ExposureMask | KeyPressMask);

    // Map (show) the window
    XMapWindow(mw.display, mw.window);

    return mw;
}

// Function to draw some text in the created window
void draw_text(MyWindow* mw, char* str, int x, int y) {
    GC gc; // Graphic Context
    XGCValues values;
    Pixmap pixmap; // For off-screen rendering, but here directly drawn to screen
    Font font;

    gc = XCreateGC(mw->display, mw->window, 0, &values); // All graphics operations
    font = XLoadQueryFont(mw->display,"7x14"); 
    XSetFont(mw->display,gc;font);
    XSetForeground(mw->display, gc, WhitePixel(mw->display, 0)); // Change color to black (you may want WhitePixel depending)
    XDrawString(mw->display,mw->window,gc,x,y,str,strlen(str));
}

int main() {
    MyWindow mw = create_window(300, 200);

    // Enter the main event loop
    for (;;) {
        XEvent e;
        while(XPending(&e)) { 
            printf("Processing Event...\n");
            // You'd want to handle specific event types, but as a starting point...
            switch (e.type) {
                case Expose:
                    puts("Redrawing Window...");
                    draw_text(&mw, "Hello, World!", 20, 40);
                    break;
                case KeyPress: // Exit on key press
                    return EXIT_SUCCESS;
            }                
        }        
        // Don't be too aggressive in querying the event queue
        usleep(100000); 
    }

    return 0;
}
```

### Compilation

Compile your program with:

```bash
gcc -o mygui -lX11 mygui.c
```

Keep in mind:

1. **Simplicity**: This example demonstrates opening a simple window and drawing text into it upon exposure events (like when the window first appears or is uncovered by another).
2. **Lack of Error Handling**: Robust programs should include proper error handling for everything.
3. **Linux Specificity**: This focuses solely on the Linux platform because of its use of the X11 API. Different platforms would require the use of different libraries and APIs (e.g., Windows: Win32 API; macOS: Cocoa or Quartz).

Again, please remember, this example barely scratches the surface of what a real GUI library does. Real-world applications involve managing multiple widgets (buttons, text boxes, sliders, etc.), more sophisticated layout systems, keyboard and mouse input management, better graphics capabilities, etc.
